import PeopleGrid from '../Components/people_grid';
import { Button, makeStyles } from '@material-ui/core';
import { Link } from 'react-router-dom';

const styles = makeStyles({
   root: {
      width: '90vw',
      height: '100vh'
   },
   link: {
      textDecoration: 'none',

   },
   button: {
      width: '40vw',
      height: '25vh',
      margin: 'auto',
      background: '#b26a00',
      fontSize: '2em',
      borderRadius: '20px',
      '&:hover': {
         backgroundColor: '#ff9800',
         color: '#ab003c'
      }
   }
});

export default function homepage() {
   let classes = styles();
   return (
      <div className={classes.root}>
         <h1>Where would you like to go?</h1>
         <Link className={classes.link} to="/"><Button className={classes.button} color="primary">Here</Button></Link>
         <Link className={classes.link} to="/"><Button className={classes.button} color="secondary">There</Button></Link>
      </div>
   );
}
